Today is world ice skating day and I am celebrating this day with another 2 shows. The solo that I am performing “I didn’t know my own Strength” by Whitney Houston, is so special to me. 
I feel the meaning of each and every word in that song. I would have never thought I would come back to being a professional ice skater onboard a cruise ship (especially not as a Manager). 
I am so grateful to @willybietakproductions for this opportunity and a special thanks to my cast for always believing in me and for being so awesome 🫶🏽

